import React from 'react'

const Top5PerMonth = ({ top5PerMonth }) => {
    console.log('hena -> ' + top5PerMonth.keys);
    return (
        <div>
            <center><h1>Top 5 Per Month</h1></center>

            <div class="card">
                <div class="card-body">
                    <p class="card-text">{top5PerMonth.keys}</p>
                </div>
            </div>

        </div>
    )
};

export default Top5PerMonth
